import { Link } from 'react-router-dom';
import styles from './pages.css';

class Home extends Component {
  render() {
    return (
    <div className="App">
      <h1 className={styles.headerStyle} >Wearing Health</h1>
      {/* Link to List.js */}
      <Link to={'./list'}>
        <button variant="raised">
            My List
        </button>
      </Link>

        <h1 className={styles.headerStyle} >Wearing Health</h1>
        {/* Link to List.js */}
        <Link to={'./list'}>
          <button variant="raised">
              My List
          </button>
        </Link>
      </div>
    );
  }
}
export default Home;
